// import React, { useEffect } from 'react';
import React, { useEffect } from "react";
import webgazer from 'webgazer';

function eyedetection() {
    useEffect(() => {
        webgazer.ready(() => {
          webgazer.setGazeListener((data, clock) => {
            console.log(data, clock);
          }).begin();
        });
      }, []);

    return(
        <div></div>
    );
};

export default eyedetection;
